Information
------------------------------

Every American who has listened to the radio knows Guthrie's &quot;This Land Is Your Land.&quot; The music of the folk singer/songwriter has been recorded by everyone from the Mormon Tabernacle Choir to U2. Originally blowing out of the Dust Bowl in Depression-era America, he blended vernacular, rural music and populism to give voice to millions of downtrodden citizens. Guthrie's music was politically leftist, uniquely patriotic and always inspirational.

